import React from 'react'
import styles from './History.module.css'

function History(props) {
    return (
        <div>
            <h1 className={styles.h1}>Expense history</h1>
            <div className={styles.historyList}>
            <ul >
                {props.items.map((user) => (
                    <li
                        key={user.id}>
                        {user.text}
                    </li>
                ))}
            </ul>
            </div>
        </div>
    )
}

export default History
